import React from "react";

function Interests() {
  return (
    <section class="resume-section" id="interests">
      <div class="resume-section-content">
        <h2 class="mb-4">Interests</h2>
        <p>My main goal is to become a Full-Stack Developer.</p>
        <p class="mb-4">I enjoy using front-end technologies thinking of making the site appealing <br />
            and back-end components to make dynamic web applications that users can interact with.</p>

        <p class="mb-0">These are my first steps as a programmer.</p>
      </div>
    </section>
  );
}

export default Interests;
